Dalyvių likimus spręs „X Faktoriaus“ teisėjas  Saulius Prūsaitis . Būtent jis rinksis, kuris dalyvis yra vertas išsvajotosios kėdės. „X Faktoriaus“ scenoje ryškiausias projekto dalyvis Alen Chicco atliks Lady Gagos dainą „Marry The Night“. Būtent šis hitas įkvėpė vaikiną būti tokiu, koks jis yra. Tomas trauks dėmesį ne tik savo vokalu, bet ir išskirtine išvaizda. Jis scenoje pasirodys avėdamas ilgus, rožinius aukštakulnius, o ant jo galvos bus uždėtas stilizuotas nuometas. Alen Chicco pasirodymą vainikuos netikėtas špagatas! Jį išvydę teisėjai sunkiai tramdys emocijas – S. Prūsaitis ir Samas pašoks iš kėdžių, o Jazzu neslėps, kad yra pakerėta šio pasirodymo. Allen Chicco „X Faktoriuje“: (function(d, s, i, r) {
