		})(document, 'script', 'facebook-jssdk', 'fb-root'); Alen Chicco noras, kad kuo daugiau žmonių išgirstų tai, kaip jis dainuoja. Po pasirodymo pirmosiose atrankose tiek žiūrovai, tiek teisėjai plojo vaikinui atsistoję. Visus sužavėjo ne tik Alen Chicco vokalas, bet ir sceninė apranga, mokėjimas elgtis scenoje. „Kai išgirdau, kad visi pradėjo rėkti, ploti, pamačiau stovinčius teisėjus ir pasimečiau. Man buvo šokas. Tokiu mastu nebuvau to patyręs“, – jau sekmadienį, 19.30 val. pasakos Alen Chicco. Allen Chicco „X Faktoriuje“: Stebint Tomą iš šono, namų aplinkoje, jis visiškai neprimena išsišokėlio. Atvirkščiai – vaikinas pasižymi kuklumu ir ramybe. Bet užtenka jam atsidurti scenoje – viskas pasikeičia. „Mano įvaizdis labai kontraversiškas ir bus tikrai neigiamų komentarų ir nuomonių. Kuo daugiau apie tave šneka, tuo esi įdomesnis. Man atrodo, kad kažką įdomaus aš tikrai parodysiu“, – įsitikinęs Alen Chicco. „X Faktoriaus“ dalyvio noras Lietuvos žmonės parodyti, kad mūsų šalis yra labai įvairi ir joje gyvena įvairūs žmonės. Tomas sako, kad pasitiki savimi ir yra įsitikinęs, kad „X Faktoriuje“ jis gali pasiekti labai daug. „Tokie žmonės neturi būti pogrindyje. Jie gali atnešti pop scenai labai daug naujų dalykų, ko dar nebuvo Lietuvoje tikrai. Aš noriu būti muzikos pasaulyje, o ne eiti dirbti papildomą darbą, ką reikia man daryti dabar. Noriu kad muzika būtų mano gyvenimo kelias“, – pasakoja TV3 projekto dalyvis. Jau gruodžio 17 d. TV3 žiūrovai išvys pirmąjį tiesiogiai transliuojamą „X Faktoriaus“ finalą.
